CREATE PROCEDURE [dbo].[spEmails_Delete]
	@Email NVARCHAR(200)
AS

BEGIN
	SET NOCOUNT ON;
	SELECT [Id], [Email], [CreatedDate] FROM dbo.Emails;
END

BEGIN
	SET NOCOUNT ON;
	SELECT [Id], [Email], [CreatedDate] FROM dbo.Emails WHERE Email = @Email;
END

CREATE PROCEDURE [dbo].[spEmails_GetByEmail]
	@Email NVARCHAR(200)
AS

BEGIN
	SET NOCOUNT ON;
	SELECT [Id], [Email], [CreatedDate] FROM dbo.Emails WHERE Id = @Id;
END

CREATE PROCEDURE [dbo].[spEmails_GetById]
	@Id NVARCHAR(50)
AS

BEGIN
	SET NOCOUNT ON;
	INSERT INTO dbo.Emails (Id, Email, CreatedDate)
	VALUES (@Id, @Email, @CreatedDate);
END

