	@Email NVARCHAR(200),
	@CreatedDate DATETIME2
AS

BEGIN
	SET NOCOUNT ON;
	DELETE FROM dbo.Records WHERE Id = @Id;
END

CREATE PROCEDURE [dbo].[spRecords_Delete]
	@Id NVARCHAR(50)
AS

BEGIN
	SET NOCOUNT ON;
	UPDATE dbo.Records
	SET Teacher = @Teacher, Room = @Room, Note = @Note, ClassNumber = @ClassNumber, ClassLetter = @ClassLetter,
	Lessons = @Lessons, [Date] = @Date WHERE Id = @Id;
END

CREATE PROCEDURE [dbo].[spRecords_Edit]
	@Id NVARCHAR(50),
	@Teacher NVARCHAR(100),
	@Room NVARCHAR(100),
	@Note NVARCHAR(MAX),
	@ClassNumber NVARCHAR(50),
	@ClassLetter NVARCHAR(50),
	@Lessons NVARCHAR(100),
	@Date DATETIME2
AS

BEGIN
	SET NOCOUNT ON;
	SELECT [Id], [Teacher], [Room], [Note], [ClassNumber], [ClassLetter], [Lessons], [Date] FROM dbo.Records
	ORDER BY [Date] DESC;
END

BEGIN
	SET NOCOUNT ON;
	SELECT [Id], [Teacher], [Room], [Note], [ClassNumber], [ClassLetter], [Lessons], [Date] FROM dbo.Records
	WHERE [Date] = @Date
	ORDER BY [Date] DESC;
END

CREATE PROCEDURE [dbo].[spRecords_GetByDate]
	@Date DATETIME2
AS

BEGIN
	SET NOCOUNT ON;
