CREATE PROCEDURE [dbo].[spRecordsTemp_Insert]
	@Id NVARCHAR(50),
	@Teacher NVARCHAR(100),
	@Room NVARCHAR(100),
	@Note NVARCHAR(MAX),
	@ClassNumber NVARCHAR(50),
	@ClassLetter NVARCHAR(50),
	@Lessons NVARCHAR(100),
	@Date DATETIME2
AS

BEGIN
	SET NOCOUNT ON;
	--BEGIN TRANSACTION;
	INSERT INTO dbo.Records (Id, Teacher, Room, Note, ClassNumber, ClassLetter, Lessons, [Date])
	SELECT [Id], [Teacher], [Room], [Note], [ClassNumber], [ClassLetter], [Lessons], [Date] FROM dbo.RecordsTemp;

	DELETE FROM dbo.RecordsTemp;
	--COMMIT;
END
